import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import { AppBar, Box, Button, Drawer, List, ListItem, ListItemText, IconButton, Menu, MenuItem } from '@mui/material';
import { Home, MenuBook, AirplanemodeActive, People, Menu as MenuIcon, Close as CloseIcon, ArrowDropDown } from '@mui/icons-material';

const MenuItems = [
  {
    title: 'Home',
    icon: <Home />,
    link: '/',
  },
  {
    title: 'Sobre',
    icon: <MenuBook />,
    link: '/about',
    submenu: [
      {
        title: 'Diretoria',
        icon: <People />,
        link: '/direction',
      },
      {
        title: 'Espaco Aereo',
        icon: <AirplanemodeActive />,
        link: '/airspace',
      },
      {
        title: 'Estatuto',
        icon: <MenuBook />,
        link: '/statute',
      },
      {
        title: 'HistÃ³ria',
        icon: <MenuBook />,
        link: '/about',
      },
      {
        title: 'Regimento Interno',
        icon: <MenuBook />,
        link: '/regiment',
      },
    ],
  },
  {
    title: 'Associados',
    icon: <People />,
    link: '/login',
  },
];

export const Navbar: React.FC = () => {
  const [isMenubarOpen, setMenubarOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);

  const toggleDrawer = () => {
    setMenubarOpen(!isMenubarOpen);
  };

  const handleMenuClick = (event: React.MouseEvent<HTMLElement>, item: any) => {
    setAnchorEl(event.currentTarget);
  };

  const handleCloseMenu = () => {
    setAnchorEl(null);
  };

  useEffect(() => {
    const handleResize = () => {
      if (window.innerWidth >= 992 && isMenubarOpen) {
        setMenubarOpen(false);
      }
    };
    window.addEventListener('resize', handleResize);
    handleResize();
    return () => window.removeEventListener('resize', handleResize);
  }, [isMenubarOpen]);

  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', boxShadow: 1 }}>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '0 1rem' }}>
        {/* Logo Section */}
        <Box>
          <RouterLink to="/">
            <img src="/logo.png" alt="Logo" style={{ height: 40 }} />
          </RouterLink>
        </Box>

        {/* Menu Desktop */}
        <Box sx={{ display: { xs: 'none', sm: 'flex' } }}>
          {MenuItems.map((item) => (
            <Button
              key={item.title}
              sx={{ color: '#1976d2', margin: '0 1rem' }}
              onClick={(e) => (item.submenu ? handleMenuClick(e, item) : null)}
            >
              <Box sx={{ display: 'flex', alignItems: 'center' }}>
                {item.icon}
                <Box sx={{ marginLeft: 0.5 }}>{item.title}</Box>
                {item.submenu && <ArrowDropDown sx={{ marginLeft: 0.5 }} />}
              </Box>
            </Button>
          ))}
        </Box>

        {/* Menu Mobile */}
        <IconButton sx={{ color: '#1976d2', display: { xs: 'block', sm: 'none' } }} onClick={toggleDrawer}>
          {isMenubarOpen ? <CloseIcon sx={{ fontSize: 36 }} /> : <MenuIcon sx={{ fontSize: 36 }} />}
        </IconButton>
      </Box>

      {/* Menu Dropdown (for submenus) */}
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleCloseMenu}
        MenuListProps={{
          'aria-labelledby': 'basic-button',
        }}
      >
        {anchorEl &&
          MenuItems.find((item) => item.title === anchorEl!.textContent)?.submenu?.map((submenuItem) => (
            <MenuItem key={submenuItem.title} onClick={handleCloseMenu}>
              <RouterLink to={submenuItem.link} style={{ color: '#1976d2', textDecoration: 'none' }}>
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  {submenuItem.icon}
                  <Box sx={{ marginLeft: 0.5 }}>{submenuItem.title}</Box>
                </Box>
              </RouterLink>
            </MenuItem>
          ))}
      </Menu>

      {/* Mobile Drawer Menu */}
      <Drawer anchor="right" open={isMenubarOpen} onClose={toggleDrawer}>
        <List sx={{ width: 250 }}>
          {MenuItems.map((item) => (
            <ListItem button key={item.title}>
              <RouterLink
                to={item.link}
                style={{
                  color: '#1976d2',
                  display: 'flex',
                  alignItems: 'center',
                  textDecoration: 'none',
                  padding: '0.5rem 1rem',
                }}
              >
                {item.icon}
                <ListItemText primary={item.title} sx={{ marginLeft: 1 }} />
              </RouterLink>
            </ListItem>
          ))}
        </List>
      </Drawer>
    </AppBar>
  );
};
